import React, {Component} from "react"

class MyApp extends Component{

    constructor(){
        super()
        this.state = {
            isLoggin: false
        }
        this.handleClick=this.handleClick.bind(this)
    }

    handleClick(){
        this.setState(prev => 
            {
                isLoggin: !prev.isLoggin
            }
        )
    }

    render(){
        return(
            <div>
                <button onClick={this.state.handleClick}>{this.state.isLoggin ? "Log out":"Log in"}</button>
            </div>
        )
    }

}

export default MyApp
